import React from 'react'
import classes from './Tasker.css'

class Tasker extends React.Component{
    state={
        name:['kek']
    };
    ChangeButtonHandler= ()=>{
        this.setState({
            name: this.state.name.push(this.state.name[0] + this.state.name.length)
        })
    };


    render(){
        return(
            <div>
                <h1>{this.state.name[0]}</h1>
                <button onClick={this.ChangeButtonHandler}>change</button>
            </div>
        )

    }


};

export default Tasker
